import React from 'react'

function SidebarOption({Icon, title}) {
    return (
      <div className='sidebarOption'>
        {Icon && <Icon />}
            {Icon ? <h3>{title}</h3> : <h3># </h3>}
      </div>
    );
}

export default SidebarOption
